import { Link } from "react-router-dom";
import "./Sidebar.css";

function Sidebar() {
  return (
    <div className="sidebar">
      <h2> BlueLine</h2>
      <nav>
        <Link to="/"> 祝 转</Link>
        <Link to="/profile"> 驻专驻</Link>
        <Link to="/login"> 转专转</Link>
        <Link to="/register"> 专砖</Link>
      </nav>
    </div>
  );
}

export default Sidebar;
